	@SuppressWarnings("deprecation")
	public static void nextPage(String lev2, String lev3, int pageSize, int curPage, List<String> list, BufferedWriter csvWriter) throws IOException {
		String view="";
		//String view = "";
		//组装参数调用接口
		Map<String, String> map = new HashMap<String,String>();
		map.put("sym", "sym|btnReq_Info");
		map.put("__EVENTTARGET", "");
		map.put("__EVENTARGUMENT", "");
		if (lev3 == null || lev3.equals("")) {
			lev3 = "samecity";
		}
		map.put("searchparas", URLEncoder.encode("icbc2:" + lev2 + ","+ lev3+ ",1,,,down,0," + curPage + "," + pageSize)); //下一页
		map.put("bbb", "");
		map.put("__VIEWSTATE", URLEncoder.encode(view));
		map.put("__ASYNCPOST", "true");
		map.put("btnReq_Info", "");

		//发送请求
		String result = HttpUtil.post(URL,map);
		//System.out.println(result);
		int s1 = result.indexOf("<div id=\"jsdatapr\" style=\"display: none\">");
		int s2 = result.indexOf("</div>");
		String json = result.substring(s1 + 42, s2);
		//System.out.println(json);
		if (json.trim().length() > 0) {
			JSONObject jsonObject = JSONObject.parseObject(json);
			JSONArray jsonArray = jsonObject.getJSONArray("SortedGuidList");
			for (int i = 0; i < jsonArray.size(); i++) {
				String key = jsonArray.getString(i);
				JSONObject net = jsonObject.getJSONObject("ICBCPointInfomationList").getJSONObject(key);
				String x = net.get("stru_id") + "," + net.get("stru_fname") + "," + net.get("stru_sname") + "," + net.get("addr_detail")+ "," +lev2 + "," + lev3 ;
				list.add(x);
				wrtieLine(csvWriter,x);
			}
		} else { 
			System.out.println("next page json is empty, continue;");
		}
		
	}
	
	@SuppressWarnings("deprecation")
	public static void getOneArea(String lev2, String lev3, BufferedWriter csvWriter) throws IOException {
		String view ="";
		//String view = "";
		//组装参数调用接口
		Map<String, String> map = new HashMap<String,String>();
		map.put("sym", "sym|btnReq_Info");
		map.put("__EVENTTARGET", "");
		map.put("__EVENTARGUMENT", "");
		if (lev3 == null || lev3.equals("")) {
			lev3 = "samecity";
		}
		map.put("searchparas", URLEncoder.encode("icbc1:" + lev2 + ","+ lev3+ ",1,,,0")); //首页
		map.put("bbb", "");
		map.put("__VIEWSTATE", URLEncoder.encode(view));
		map.put("__ASYNCPOST", "true");
		map.put("btnReq_Info", "");

		//发送请求
		String result = HttpUtil.post(URL,map);
		int s1 = result.indexOf("<div id=\"jsdatapr\" style=\"display: none\">");
		int s2 = result.indexOf("</div>");
		String json = result.substring(s1 + 42, s2);
		//System.out.println(json);
		JSONObject jsonObject = JSONObject.parseObject(json);
		if (json.trim().length() > 0) {
			JSONArray jsonArray = jsonObject.getJSONArray("SortedGuidList");
			List<String> list = new ArrayList<String>();
			for (int i = 0; i < jsonArray.size(); i++) {
				String key = jsonArray.getString(i);
				JSONObject net = jsonObject.getJSONObject("ICBCPointInfomationList").getJSONObject(key);
				String x = net.get("stru_id") + "," + net.get("stru_fname") + "," + net.get("stru_sname") + "," + net.get("addr_detail")+ "," +lev2 + "," + lev3 ;
				list.add(x);
				wrtieLine(csvWriter,x);
			}
			int pageSize = jsonObject.getIntValue("TotalPageCount");
			int curPage =  jsonObject.getIntValue("CurrentPageIndex");
			if (pageSize > 1 && curPage == 1) {
				for (int i = 1; i < pageSize; i++) {
				  nextPage(lev2, lev3, pageSize, i, list, csvWriter);	
				}
			}
		} else {
			System.out.println("first page json is empty, continue;");
		}
	}
	

